import React from "react";

function Note(props){
    
    function deleteitem(){
        props.ondelete(props.id);
        event.preventDefault();
    }
    return (
        <div className="note">
            <h3>{props.title}</h3>
            <p>{props.content}</p>
            <button className="btn" onClick={deleteitem}>Delete</button>
        </div>
    )
}

export default Note;
